package hxz.www.commonbase.cache;

public   class UserInfo {

        private String token;
        private Object id;
        private String username;
        private String fullname;
        private Object mobile;
        private Object idNo;
        private Object sex;
        private Object nativePlace;
        private Object telephone;
        private Object email;
        private Object politicalStatus;
        private Object job;

        public String getToken() {
            return token;
        }

        public void setToken(String token) {
            this.token = token;
        }

        public Object getId() {
            return id;
        }

        public void setId(Object id) {
            this.id = id;
        }

        public String getUsername() {
            return username;
        }

        public void setUsername(String username) {
            this.username = username;
        }

        public String getFullname() {
            return fullname;
        }

        public void setFullname(String fullname) {
            this.fullname = fullname;
        }

        public Object getMobile() {
            return mobile;
        }

        public void setMobile(Object mobile) {
            this.mobile = mobile;
        }

        public Object getIdNo() {
            return idNo;
        }

        public void setIdNo(Object idNo) {
            this.idNo = idNo;
        }

        public Object getSex() {
            return sex;
        }

        public void setSex(Object sex) {
            this.sex = sex;
        }

        public Object getNativePlace() {
            return nativePlace;
        }

        public void setNativePlace(Object nativePlace) {
            this.nativePlace = nativePlace;
        }

        public Object getTelephone() {
            return telephone;
        }

        public void setTelephone(Object telephone) {
            this.telephone = telephone;
        }

        public Object getEmail() {
            return email;
        }

        public void setEmail(Object email) {
            this.email = email;
        }

        public Object getPoliticalStatus() {
            return politicalStatus;
        }

        public void setPoliticalStatus(Object politicalStatus) {
            this.politicalStatus = politicalStatus;
        }

        public Object getJob() {
            return job;
        }

        public void setJob(Object job) {
            this.job = job;
        }
    }